import React, { Component } from 'react';

class Footer extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="container">
                <div className="row">

                    <img src="https://zerodha.com/static/images/logo.svg" />
                </div>

            </div>
        )
    }
}

export default Footer;
